import { SectionWrapper, Title, GamingLibraryCard } from "../../components/";
import "./GamingLibrary.css";
import GamingLibraryCardData from "../../Data/GamingLibraryData";
function GamingLibrary() {
  const gamingLibraryCardData = GamingLibraryCardData.map((member) => (
    <GamingLibraryCard
      key={member.id}
      image={member.image}
      name={member.name}
      type={member.type}
      dateAdded={member.date_Added}
      hoursPlayed={member.hours_played}
      currently={member.currently}
    />
  ));
  return (
    <SectionWrapper>
      <Title titlePrimary="your Gaming" titleSecondary=" Library" />
      {gamingLibraryCardData}
    </SectionWrapper>
  );
}

export default GamingLibrary;
